import React, { useState, useEffect } from 'react';

import { createHashHistory } from 'history';

import api from './services/api';

function App() {
  const [express, setExpress] = useState({});
  const [id, setId] = useState('');

  async function getInfo() {
    const response = await api('/');

    if (response.status !== 200) throw Error('Error');

    return setExpress(response.data);
  }

  async function sendVideoInfos() {
    const response = await api('/', {
      method: 'POST',
      data: {
        id
      },
    });

    const history = createHashHistory();
    history.go(response.data);
    console.log(response);
  }

  useEffect(() => {
    getInfo();
  }, []);

  return (
    <div className="App">
      <input type="text" onChange={(e) => { return setId(e.target.value) }} />
      <button type="button" onClick={sendVideoInfos}>Clique aqui</button> <br />
      Back-end: {express.express}
    </div>
  );
}

export default App;
